import React, {useEffect} from 'react'
import { useNavigate } from "react-router-dom";

export default function RedirectPage() {
    const navigate = useNavigate();

    useEffect(() => {
      // Redirect to Home screen from base URL
      navigate("/" + 'UK')
    }, []);

  return (
    <div></div>
  )
}
